"39281" : {
"id":39281,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"name":"Controle scripts: 1: Controleer of alle Enum literals getoond worden Wanneer een Enumeration uitgebreid wordt met √©√©n of meer nieuwe literals, worden deze literals niet automatisch ook op de views (UML klasse diagram) waarop de Enumeration staat toegevoegd. Om ze wel op deze views te tonen, moet de hele enumeration opnieuw op de view gezet worden. Dit gaat regelmatig mis; het script controleert of alle enumeration literals van een enumeration die in het model op een view getoond ook daadwerkelijk voorkomen op de view.  2: Controleer koppeling van de regels Regels kennen onderlinge samenhang d.m.v. relaties en zijn gerelateerd aan de gegevenslaag d.m.v. modeloverstijgende relaties. Wanneer relaties niet goed zijn gelegd, worden niet de juiste koppelingen getoond in het informatiemodel. Het script controleert de volgende relaties en geeft per relatie een overzicht van de regels waar die niet goed zijn: 1. Een ArchiMate principe (uitgangspunt) wordt gerealiseerd door minimaal √©√©n ArchiMate Requirement (bedrijfsregel). 2. Een ArchiMate Requirement (bedrijfsregel) realiseert minimaal √©√©n ArchiMate principe (uitgangspunt).  3. Een ArchiMate Requirement (bedrijfsregel) is met een modeloverstijgende associatierelatie gekoppeld aan minimaal √©√©n UML-klasse met profiel ‚ÄúBerichtklasse Root‚Äù.  4. Een ArchiMate Beperking; profiel Technische regel is met een (niet modeloverstijgende!) associatierelatie gekoppeld aan een ArchiMate Requirement (bedrijfsregel). 5. Een ArchiMate Beperking met profiel Technische regel is niet met een modeloverstijgende associatierelatie gekoppeld aan een ArchiMate Requirement (bedrijfsregel).   3: Controleer of regeltype goed is ingesteld Alle regels worden gedefinieerd binnen de ArchiMate Motivation extension; ArchiMate principes worden automatisch gelabeld als Uitgangspunt, ArchiMate Requirements worden automatisch gelabeld als Bedrijfsregel en ArchiMate Usecases worden automatisch gelabeld als Invulinstructie. De ArchiMate Beperking wordt voor meerdere regeltypen gebruikt; hier moet handmatig een keuze gemaakt worden voor een profiel. Het script controleert of er een keuze is gemaakt: ArchiMate Beperking heeft ZIN profiel Constraint, Conditie of Technische regel. Regels waarvoor dit ontbreekt worden in een workset getoond.",
"type":"Tekenvorm"
}
]
}
,
"39283" : {
"id":39283,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"name":"Gebruik het viewpoint \"Vul 'Waar gebruikt voor rapportage\" voordat een model geexporteerd wordt voor rapportage.  Voor dit viewpoint is een eigenschap \"waar gebruikt\" toegevoegd aan verschillende onderdelen van het model. Opgehaald worden alle geassocieerde attributen of klassen, gevuld wordt op welke views deze voorkomen. Dit wordt ook meegenomen naar de inSight rapportage zodat daar ook te zien is in welke berichten datatypen en regels gebruikt worden.  De functie van dit script is om in de insite publicatie ook het nuttige deel van ‚Äúwaar gebruikt‚Äù functionaliteit te reproduceren. Daarvoor is bij een aantal concepten de eigenschap Wordt gebruikt in toegevoegd.   Die concepten zijn: ‚Ä¢ Alle regeltypes in ArchiMate ‚Ä¢ UML klassen ‚Ä¢ UML attributen ‚Ä¢ UML datatypes  Alle objecten in het modelpackage die deze eigenschap hebben worden ververst bij het uitvoeren van het script.  ‚Ä¢ Bij regels worden alle views (= berichten) opgenomen waarop een klasse of attribuut staat die verbonden is aan de regel, of waarvan het datatype verbonden is aan de regel ‚Ä¢ Bij alle uml objecten worden alle views (= berichten) opgenomen waarop een attribuut staat waarin het object wordt gebruikt. Voor een datatype betekent dit de views waarop attributen staan waarin dit datatype wordt gebruikt. ‚Ä¢ Klassen en attributen worden over het algemeen niet op andere plekken gebruikt, maar als het toch voorkomt wordt het met dit script inzichtelijk gemaakt voor de lezer.  Dit script moet voor elke publicatie uitgevoerd worden om de inhoud van de eigenschap bij te werken.  In v3 van het script is een wijziging doorgevoerd zodat het veld \"'waar gebruikt\" leeg gemaakt wordt wanneer er geen koppelingen meer zijn.",
"type":"Tekenvorm"
}
]
}
