,
"45333" : {
"id":45333,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"name":"Uitgangspunten, bedrijfsregels en technische regels komen in principe voort uit het proces, dat kan het clientproces of het berichtproces zijn.  Uitgangspunten worden gedefinieerd als ArchiMate principes en worden per standaard apart gedefinieerd. Een uitgangspunt wordt gerealiseerd door een of meer bedrijfsregels. Koppeling wordt gelegd door een realisatierelatie.  Bedrijfsregels worden gedefinieerd als ArchiMate requirements. Ze horen bij een proces (via associatierelatie) en/of bij √©√©n of meer berichten, via een modeloverstijgende associatie relatie met de berichtklasse root. Op een bedrijfsregel kunnen √©√©n of meer uitzonderingen gedefinieerd worden. Dit is een specialisatie van een bedrijfsregel. De uitzondering krijgt dezelfde regelcode als de regel waarop de uitzondering betrekking heeft met toevoeging van \"x\" en een volgnummer (zoals OP033x1). Bedrijfsregels worden indien mogelijk uitgewerkt in technische regels. Bedrijfsregels die niet zijn uitgewerkt in een technische regel kunnen als zodanig gemarkeerd worden in de profielinformatie (hier doen we op dit moment niks mee).  Technische regels worden gedefinieerd als ArchiMate beperkingen, met als profiel \"Technische regel\". Ze vormen de technische controleerbare vertaling van een bedrijfsregel. Iedere technische regel is dus ook gekoppeld aan (minstens) een bedrijfsregeleen associatie relatie. Let op: dit is een 'normale' associatierelatie, g√©√©n modeloverstijgende. Technische regels zijn van toepassing op een berichtklasse of een berichtelement via een modeloverstijgende associatierelatie. Bij een techische regels moet in de profielinformatie (\"niveau\") worden aangegeven of deze berichtoverstijgend is of niet (standaard).",
"type":"Tekenvorm"
}
]
}
